import React, { useState } from 'react'

const Faq = () => {
    const [toggle, setToggle] = useState(false);
    const handelCLick = () => {
        if (toggle === false) {
            setToggle(true)
        } else {
            setToggle(false)
        }
    }
    return (
        <>
            <div className='d-flex border border-dark  p-2 flex-column' style={{ width: '100%', height: '50vh', background: '#64bc6e' }}>
                <div className='d-flex justify-content-center'>
                    <h1>FAQ'S</h1>
                </div>
                <div className='d-flex flex-column justify-content-center bt-0' style={{ width: '50vw' }}>
                    <div className=' border border-dark' onClick={() => { handelCLick() }}>
                        <p>Why should I consult Dr. Manik Dalvi?</p>
                    </div>
                    {toggle ? <div className='mt-0 border border-dark'>
                        <p>Why should I consult Dr. Manik Dalvi?</p>
                    </div> : null}
                </div>
            </div>
        </>
    )
}

export default Faq
